// import React from "react";
import React, { useState } from 'react';

import "./App.css";
import Page from "./Page";
import mePic from "./imgs/me.jpg";

function App() {
  const listData = [
    { id: 1, title: 'Item 1', description: 'Additional info for Item 1.' },
    { id: 2, title: 'Item 2', description: 'Additional info for Item 2.' },
    // Add more items as needed
  ];

  return (
    <div className="App">
      <Page mainCookie = {mePic} additional = {listData}> </Page>
      <Page mainCookie = "Professional Experience" additional = "Test"> </Page>
      <Page mainCookie = "Projects" additional = "Test"> </Page>
      <Page mainCookie = "Leadership" additional = "Test"> </Page>
      <Page mainCookie = "More About Me" additional = "Test"> </Page>
      <Page mainCookie = "Reach out!" additional = "Test"> </Page>
    </div>
  );
}

export default App;
